import React, { useState } from 'react';
import { useNavigate, useLocation } from 'react-router-dom';
import {
  AppBar,
  Toolbar,
  Typography,
  Button,
  IconButton,
  Box,
  Avatar,
  Menu,
  MenuItem,
  Badge,
  Divider,
  ListItemIcon,
  ListItemText,
} from '@mui/material';
import {
  Eco as EcoIcon,
  Dashboard as DashboardIcon,
  Add as AddIcon,
  Store as MarketplaceIcon,
  AccountBalance as CarbonIcon,
  Payment as PaymentIcon,
  Assessment as ReportsIcon,
  Notifications as NotificationsIcon,
  Person as PersonIcon,
  Logout as LogoutIcon,
  AdminPanelSettings as AdminIcon,
  Settings as SettingsIcon,
} from '@mui/icons-material';

const ProfessionalNavbar = () => {
  const navigate = useNavigate();
  const location = useLocation();
  
  const [anchorEl, setAnchorEl] = useState(null);
  const [userInfo] = useState(() => {
    const stored = localStorage.getItem('userInfo');
    return stored ? JSON.parse(stored) : null;
  });

  const handleMenuOpen = (event) => {
    setAnchorEl(event.currentTarget);
  };

  const handleMenuClose = () => {
    setAnchorEl(null);
  };

  const handleLogout = () => {
    localStorage.removeItem('userInfo');
    localStorage.removeItem('auth_token');
    navigate('/login');
    handleMenuClose();
  };

  const navItems = [
    { 
      label: 'Dashboard', 
      path: '/dashboard', 
      icon: <DashboardIcon fontSize="small" />
    },
    { 
      label: 'Create Project', 
      path: '/projects/create', 
      icon: <AddIcon fontSize="small" />
    },
    { 
      label: 'Marketplace', 
      path: '/marketplace', 
      icon: <MarketplaceIcon fontSize="small" />
    },
    { 
      label: 'Carbon Credits', 
      path: '/carbon-credits', 
      icon: <CarbonIcon fontSize="small" />
    },
    { 
      label: 'Payments', 
      path: '/payments', 
      icon: <PaymentIcon fontSize="small" />
    },
    { 
      label: 'Reports', 
      path: '/reports', 
      icon: <ReportsIcon fontSize="small" />
    },
  ];

  const isActive = (path) => location.pathname === path;

  return (
    <AppBar 
      position="fixed" 
      elevation={0}
      sx={{
        backgroundColor: '#FFFFFF',
        borderBottom: '1px solid #E2E8F0',
        color: '#1E293B',
      }}
    >
      <Toolbar sx={{ justifyContent: 'space-between', px: { xs: 2, md: 3 } }}>
        {/* Logo Section */}
        <Box 
          sx={{ 
            display: 'flex', 
            alignItems: 'center', 
            cursor: 'pointer',
          }}
          onClick={() => navigate('/dashboard')}
        >
          <EcoIcon
            sx={{
              color: '#0C4A6E',
              mr: 1.5,
              fontSize: 32,
            }}
          />
          <Box>
            <Typography 
              variant="h6" 
              component="div" 
              sx={{ 
                fontWeight: 600,
                color: '#0C4A6E',
                lineHeight: 1,
              }}
            >
              Blue Carbon MRV
            </Typography>
            <Typography 
              variant="caption" 
              sx={{ 
                color: '#64748B',
                fontSize: '0.75rem',
              }}
            >
              Coastal Ecosystem Platform
            </Typography>
          </Box>
        </Box>

        {/* Navigation Items */}
        <Box sx={{ display: { xs: 'none', md: 'flex' }, gap: 1 }}>
          {navItems.map((item) => (
            <Button
              key={item.path}
              startIcon={item.icon}
              onClick={() => navigate(item.path)}
              sx={{
                px: 2,
                py: 1,
                textTransform: 'none',
                fontWeight: 500,
                borderRadius: 2,
                color: isActive(item.path) ? '#0C4A6E' : '#64748B',
                backgroundColor: isActive(item.path) ? '#F1F5F9' : 'transparent',
                '&:hover': {
                  backgroundColor: '#F1F5F9',
                  color: '#0C4A6E',
                },
                transition: 'all 0.2s ease',
              }}
            >
              {item.label}
            </Button>
          ))}
        </Box>

        {/* Right Section */}
        <Box sx={{ display: 'flex', alignItems: 'center', gap: 1.5 }}>
          {/* Notifications */}
          <IconButton
            sx={{
              color: '#64748B',
              '&:hover': {
                backgroundColor: '#F1F5F9',
                color: '#0C4A6E',
              },
            }}
          >
            <Badge badgeContent={3} color="error" variant="dot">
              <NotificationsIcon />
            </Badge>
          </IconButton>

          {/* User Menu */}
          <Button
            onClick={handleMenuOpen}
            sx={{
              display: 'flex',
              alignItems: 'center',
              gap: 1,
              textTransform: 'none',
              color: '#1E293B',
              borderRadius: 2,
              px: 1.5,
              py: 0.5,
              '&:hover': {
                backgroundColor: '#F1F5F9',
              },
            }}
          >
            <Avatar
              sx={{
                width: 32,
                height: 32,
                backgroundColor: userInfo?.userType === 'admin' ? '#059669' : '#0C4A6E',
                fontSize: '1rem',
              }}
            >
              {userInfo?.userType === 'admin' ? <AdminIcon /> : <PersonIcon />}
            </Avatar>
            
            <Box sx={{ display: { xs: 'none', md: 'block' }, textAlign: 'left' }}>
              <Typography variant="subtitle2" sx={{ fontSize: '0.875rem', fontWeight: 500 }}>
                {userInfo?.name || 'User'}
              </Typography>
              <Typography variant="caption" color="text.secondary">
                {userInfo?.userType === 'admin' ? 'Administrator' : 'Community User'}
              </Typography>
            </Box>
          </Button>

          <Menu
            anchorEl={anchorEl}
            open={Boolean(anchorEl)}
            onClose={handleMenuClose}
            PaperProps={{
              sx: {
                mt: 1,
                minWidth: 200,
                boxShadow: '0 4px 6px rgba(0, 0, 0, 0.05)',
                border: '1px solid #E2E8F0',
              }
            }}
            transformOrigin={{ horizontal: 'right', vertical: 'top' }}
            anchorOrigin={{ horizontal: 'right', vertical: 'bottom' }}
          >
            <Box sx={{ px: 2, py: 1.5 }}>
              <Typography variant="subtitle2" sx={{ fontWeight: 600 }}>
                {userInfo?.email}
              </Typography>
              <Typography variant="caption" color="text.secondary">
                {userInfo?.userType === 'admin' ? 'System Administrator' : 'Community Member'}
              </Typography>
            </Box>
            
            <Divider />
            
            <MenuItem onClick={handleMenuClose}>
              <ListItemIcon>
                <SettingsIcon fontSize="small" />
              </ListItemIcon>
              <ListItemText>Settings</ListItemText>
            </MenuItem>
            
            <Divider />
            
            <MenuItem onClick={handleLogout} sx={{ color: 'error.main' }}>
              <ListItemIcon>
                <LogoutIcon fontSize="small" color="error" />
              </ListItemIcon>
              <ListItemText>Sign Out</ListItemText>
            </MenuItem>
          </Menu>
        </Box>
      </Toolbar>
    </AppBar>
  );
};

export default ProfessionalNavbar;
